import React from 'react';
import axios from 'axios';
import { useEffect, useState } from 'react';
import { useNavigate } from "react-router-dom";

export default function SearchPatients() {
    const [listOfPatients, setListofPatients] = useState([]);
     let navigate = useNavigate(); 




    useEffect(() => {
      axios.get("http://localhost:3001/patientsinfo").then((response) => {
        setListofPatients(response.data);
      })

      axios.get("http://localhost:3001/patientsinfo").then((response) => {
        console.log(response.data.length);
      })

    }, []);
  
    return(
      <table>
        <div className='h-lvh max-h-full overflow-auto'>
          <tr>
                    <th>Id</th>
                    <th>Name</th>
                    <th>Sex</th>
                    <th>Location</th>
                    <th>PhoneNumber</th>
          </tr>
          {listOfPatients.map((value, key) => {
            return(
              <div onClick={() => navigate(`/patientsinfo/${value.id}`)}>
                <table>

                </table>
                className='p-10 bg-slate-800 rounded-lg mr-10 my-10'
                 {value.firstName} | {value.lastName} | {value.sex}| {value.location} | {value.phoneNumber} | {value.id}
              </div>

            )
          })}
        </div>
      </table>
    )
}
